import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Index from './Components/index_page/Index';
import React from 'react';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path='/' element={<Index/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
